        'Work closely with HQ Brand Marketing/CRM/Retail Marketing teams to adapt global campaigns, as well as developing & launching local campaigns that follow brand guideline and boom local business. Key responsibilities include belows:\n£¿ Seasonal direct advertising calendar (OOH/Magazine/DM) in associate with HQ/production vendor.\n£¿ New store opening 360-degree marketing plan, including local media advertising/local OOH/customer communication/in-store promotion/online advertising.\n£¿ Store events (seasonal preview, model trunk show, private luncheon, etc.) to reward the most loyal customers, drive store traffic and boom sales.\n£¿ Monthly product marketing plans of key delivery push in associate with Merchandising team.\n£¿ Gifting plans (tier gifts for VIP program, GWP for in-store promotion/landlord promotion, special event & new door opening) to enhance brand awareness & customer connection and to drive store traffic and sales.\n£¿ Set up Company promotion policy to protect brand image, work with Retail Management team to identify business opportunities and evaluate promotion requests from Retail team to deploy monthly brand promotion plan; track promotion metrics/historical result/net plus of LY vs. TY for monitoring and analysis.\nCRM:\n£¿ Customer Database Management: streamlined in-store customer data capture process, revamped store POS system & customer information interface by collaborating with IT team, identify key strategy/roadmap and set KPI for stores to achieve monthly/quarterly target, manage CRM agency to perform monthly data auditing/cleansing.\n£¿ VIP Customer Loyalty Program: develop and manage Michael Kors Greater China (Mainland China, Hong Kong, Macau and Taiwan regions) VIP Customer Loyalty Program in associate with HQ/IT team, provide a variety of beneficial and experiential privileges to different customer segments, fulfill local market¡¯s business needs, drive customer re-purchase rate and VIP sales penetration.\n£¿ O2O Program (WeChat Customer Platform): develop and deploy MK WeChat customer platform to well engage, retain and communicate with existing customers by offering online-exclusive privileges and drive customers to offline stores.\n£¿ Multi-channel Customer Communication: plan and deployed 360-degree customer communication in line with global guideline and local campaign timeline, via direct mailing/MMS/SMS/email/OBC channels.\n£¿ CRM System & Loyalty Engine Maintenance: monitor and maintain the CRM system & loyalty engine by collaborating with IT/CRM agency on a daily basis.\n£¿ Clientele Report & Analysis: perform weekly customer database and monthly clientele analysis, share results and reports to Top Management and Retail team to identify future business opportunities and set action plans, by looking into customer spend & frequency matrix, in-base recruitment status, VIP sales penetration, customer lifetime, customer purchase behavior by age/sex/product category, re-purchase trend by different customer segments, etc.\n£¿ Call Center & Customer Service: manage brand call center by collaborating with IT/3-rd party agency, solve customer complaints and provide them with qualified customer services by working with Retail team.\n£¿ Competitive Research: plan and perform quarterly competitive research in terms of in-store marketing campaign and CRM programs.', 
        '1|100', null, 0, null, '20161209000000888000000001', 'À¶Ìì', to_date('22-03-2017 10:55:01', 'dd-mm-yyyy hh24:mi:ss'), 30, '11', '0', 0, null, '11', null);
