eChat Customer Platform): develop and deploy MK WeChat customer platform to well engage, retain and communicate with existing customers by offering online-exclusive privileges and drive customers to offline stores.\n£¿ Multi-channel Customer Communication: plan and deployed 360-degree customer communication in line with global guideline and local campaign timeline, via direct mailing/MMS/SMS/email/OBC channels.\n£¿ CRM System & Loyalty Engine Maintenance: monitor and maintain the CRM system & loyalty engine by collaborating with IT/CRM agency on a daily basis.\n£¿ Clientele Report & Analysis: perform weekly customer database and monthly clientele analysis, share results and reports to Top Management and Retail team to identify future business opportunities and set action plans, by looking into customer spend & frequency matrix, in-base recruitment status, VIP sales penetration, customer lifetime, customer purchase behavior by age/sex/product category, re-purchase trend by different customer segments, etc.\n£¿ Call Center & Customer Service: manage brand call center by collaborating with IT/3-rd party agency, solve customer complaints and provide them with qualified customer services by working with Retail team.\n£¿ Competitive Research: plan and perform quarterly competitive research in terms of in-store marketing campaign and CRM programs.', 
        '1|100', null, 0, null, '20161209000000888000000001', 'À¶Ìì', to_date('22-03-2017 10:55:01', 'dd-mm-yyyy hh24:mi:ss'), 30, '11', '0', 0, null, '11', null);
